import React, {  StrictMode } from 'react';
import { CookiesProvider } from 'react-cookie';
import ApiContextProvider from "./context/ApiContext";



import "./main.scss"

// ユーザー毎の機能
import Home from "./pages/Home"
import RecommendPosts from "./pages/ReccomendPosts";
import Recommend from "./pages/Recommend";
import Userpage from "./pages/Userpage";
import Recommenduser from "./pages/Recommenduser";
import Request from "./pages/Request";
import Users from "./pages/Users";
import Following from './pages/Following';
import MutualFollowing from './pages/MutualFollowing';

// 内容
import Mono from "./pages/Mono";
import SpecificUserpage from "./pages/SpecificUserpage";

// 初期設定
import Login from "./pages/Login";

// 設定
import Settings from "./pages/Settings";
import Account from "./pages/Account";

// アナリティクス
import Analytics from "./pages/Analytics";

import { BrowserRouter, Switch, Route  } from 'react-router-dom';

const App = () => {
    console.log(process.env.PUBLIC_URL)

        return(
            <ApiContextProvider>
            <StrictMode>
            <BrowserRouter>
                <CookiesProvider>
                <Switch>
                    <Route exact path = {`${process.env.PUBLIC_URL}`} component={Login}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}home`} component={Home}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}reccomendposts`} component={RecommendPosts}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}recommend`} component={Recommend}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}userpage`} component={Userpage}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}recommenduser`} component={Recommenduser}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}users`} component={Users}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}/mono`} component={Mono}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}/request`} component={Request}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}/login`} component={Login}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}/settings`} component={Settings}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}/account`} component={Account}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}/analytics`} component={Analytics}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}/specificuserpage`} component={SpecificUserpage}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}/following`} component={Following}/>
                    <Route exact path = {`${process.env.PUBLIC_URL}/mutualfollowing`} component={MutualFollowing}/>


                </Switch>
                </CookiesProvider>
            </BrowserRouter>
            </StrictMode>
            </ApiContextProvider>

        )

}


export default App;
